import { UPDATE_INCOME } from "../actions/action-types";

const incomeState = {
    rent: null,
    royalties: null,
    other: null,
    federal_tax_withheld: null,
    non_employee_comp: null,
    s409a_income: null,
    s409a_deferrals: null,
    fish_boat: null,
    medical_payments: null,
    substitute_payments: null,
    direct_sales: false,
    state_tax_withheld: null,
    state_tax_id: null,
    state_income: null,
    isValidIncome: false,
}

export default function incomeReducer(state = incomeState, action) {
    switch( action.type ) {
        case UPDATE_INCOME: 
            return action.payload 

        default:
            return state;
    }
};
